import React, { Component } from "react";
import { FormattedMessage } from "react-intl";
import { connect } from "react-redux";
import { getAllCodeService } from "../../services/userServices";

class UserRedux extends Component {
    constructor(props) {
        super(props);
        this.state = {
            genderArr: [],
        };
    }

    async componentDidMount() {
        try {
            let res = await getAllCodeService("gender");

            if (res && res.errCode === 0) { // Sửa lại chỗ này
                this.setState({ genderArr: res.data });
            }
        } catch (error) {
            console.log(error);
        }
    }

    render() {
        console.log("check state", this.state);
        let genders = this.state.genderArr;
        return (
            <div className="user-redux-container">
                <div className="title">User Create Redux by "anhtonton"</div>
                <div className="user-redux-body">
                    <div className="container">
                        <div className="row">
                            <div className="mb-3">Thêm mới người dùng</div>
                            <form>
                                <div className="row mb-3">
                                    <div className="col-md-3">
                                        <label htmlFor="email" className="form-label">Email</label>
                                        <input type="email" className="form-control" id="email" placeholder="Email" />
                                    </div>

                                    <div className="col-md-3">
                                        <label htmlFor="password" className="form-label">Password</label>
                                        <input type="password" className="form-control" id="password" placeholder="Password" />
                                    </div>

                                    <div className="col-md-3">
                                        <label htmlFor="firstName" className="form-label">Firstname</label>
                                        <input type="text" className="form-control" id="firstName" placeholder="Firstname" />
                                    </div>
                                    <div className="col-md-3">
                                        <label htmlFor="lastName" className="form-label">Lastname</label>
                                        <input type="text" className="form-control" id="lastName" placeholder="Lastname" />
                                    </div>
                                </div>
                                <div className="row mb-3">
                                    <div className="col-md-3">
                                        <label htmlFor="phonenumber" className="form-label">Phonenumber</label>
                                        <input type="text" className="form-control" id="phonenumber" placeholder="Phonenumber" />
                                    </div>
                                    <div className="col-md-9">
                                        <label htmlFor="address" className="form-label">Address</label>
                                        <input type="text" className="form-control" id="address" placeholder="1234 Main St" />
                                    </div>
                                </div>
                                <div className="row mb-3">
                                    <div className="col-md-3">
                                        <label htmlFor="gender" className="form-label">Gender</label>
                                        <select id="inputState" className="form-control">
                                            {genders && genders.length > 0 && genders.map((item, index) => {
                                                return (
                                                    <option key={index}>{item.valueVi}</option>
                                                );
                                            })}
                                        </select>
                                    </div>

                                    <div className="col-md-3">
                                        <label htmlFor="position" className="form-label">Position</label>
                                        <select id="inputState" className="form-control">
                                            <option selected>Choose...</option>
                                            <option>...</option>
                                        </select>
                                    </div>

                                    <div className="col-md-3">
                                        <label htmlFor="role" className="form-label">Role</label>
                                        <select id="inputState" className="form-control">
                                            <option selected>Choose...</option>
                                            <option>...</option>
                                        </select>
                                    </div>
                                    <div className="col-md-3">
                                        <label htmlFor="avatar" className="form-label">Avatar</label>
                                        <input type="file" className="form-control-file" id="exampleFormControlFile1" />
                                    </div>
                                </div>

                                <button type="submit" className="btn btn-primary">Submit</button>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    return {};
};

const mapDispatchToProps = (dispatch) => {
    return {};
};

export default connect(mapStateToProps, mapDispatchToProps)(UserRedux);
